$(function(){
  $(".site-header__search, #header-nav-dropdown").click(function (){
    var panel = $("#site-header__search-panel");
    if(panel.length > 0){
      if(this.classList.contains("active")){
        this.classList.remove("active");
        panel[0].classList.remove("active");
      }else{
        this.classList.add("active");
        panel[0].classList.add("active");
      }
    }
  });
});
function attachSearchHandlers(el, ev){
  ev.preventDefault();
  var ul = $(el).closest("ul");
  updatePage(el, ul);
  paginationEllipsis(ul);
  $(ul).children("li").children("a").click(function(event){
    event.preventDefault();
    attachSearchHandlers(this, event);
  });
  sendSearchRequest(el, ul);
}

function resetPagination(ul, sort){
  if(sort){
    $(ul).attr("data-sort", sort);
  }
  var el = $(ul.children("li")[0]).children("a")[0];
  updatePage(el, ul);
  paginationEllipsis(ul);
  $(ul).children("li").children("a").click(function(event){
    event.preventDefault();
    attachSearchHandlers(this, event);
  });
}

function attachSortByHandler(el, ev){
  ev.preventDefault();
  el.classList.add("disabled");
  var text = el.innerText;
  var ul = $(el).parent().siblings(".subheading").children("ul");
  $(el).siblings("a").each(function(){
    this.classList.remove("disabled");
  })
  resetPagination(ul, text.toLowerCase());
  sendSearchRequest(el, ul, 0, text.toLowerCase());
}

function updatePage(el, ul){
  if(!el.classList.contains("active")){
    try{
      $(ul).children("li").each(function(){
        if($(this).children(".active").length > 0){
          $(this).children(".active")[0].classList.remove("active");
        }
      });
    }catch(e){}
    el.classList.add("active");
  }
}

function paginationEllipsis(el){
  $(el).children("li.ellipsis").remove();
  var pages = $(el).children("li");
  var currentPage = parseInt($(el).children("li").children(".active")[0].innerText);
  var lastPage = parseInt(pages.last().children("a")[0].innerText);
  if(lastPage > 6){
    pages.remove();
    $(el).append('<li><a href="#" class="' + (currentPage == 1 ? 'active' : '') + '">1</a></li>');
    if(currentPage < 5){
      for(var i=2; i<=5; i++){
        $(el).append('<li><a href="#" class="' + (currentPage == i ? 'active' : '') + '">' + i + '</a></li>');
      }
      $(el).append('<li class="ellipsis">...</li>');
    }else if(lastPage - currentPage < 4){
      $(el.append('<li class="ellipsis">...</li>'));
      for(var i = lastPage - 4; i < lastPage; i++){
        $(el).append('<li><a href="#" class="' + (currentPage == i ? 'active' : '') + '">' + i + '</a></li>');
      }
    }else{
      $(el.append('<li class="ellipsis">...</li>'));
      for(var i = currentPage - 2; i <= currentPage + 2; i++){
        $(el).append('<li><a href="#" class="' + (currentPage == i ? 'active' : '') + '">' + i + '</a></li>');
      }
      $(el.append('<li class="ellipsis">...</li>'));
    }
    if(lastPage > 1){
      $(el).append('<li><a href="#" class="' + (currentPage == lastPage ? 'active' : '') + '">' + lastPage + '</a></li>');
    }
  }
}

function sendSearchRequest(el, ul, pageOverride, sortOverride){
  var number = pageOverride;
  if(number == undefined){
    number = el.innerText - 1;
  }
  var template = ul.attr("data-template");
  var resultsPerPage = ul.attr("data-resultsperpage");
  var sort = sortOverride || ul.attr("data-sort");
  var url = new URL(window.location.href);
  var search = url.searchParams.get("q");
  var resource = $("#data-resource").attr("href").replace(".html","");
  var resultsArea = $(ul).closest(".subheading").siblings("ul")[0];
  var path = encodeURI(resource + ".results" + "." + template + "." + search + "." + resultsPerPage + "." + sort + "." + number + ".html");
  $.get(path, function(data, status, xhr){
    if(xhr.status = 200){
      $(resultsArea).html(data);
    }
  });
}

$(function(){
  $(".search-results .search-results-bottom .results .subheading ul").each(function() {
    paginationEllipsis(this);
  });
  $(".search-results .search-results-bottom .results .subheading ul > li > a").click(function(event) {
    event.preventDefault();
    attachSearchHandlers(this, event);
  });
  $(".search-results .search-results-bottom .results .sortby a").click(function(event){
    event.preventDefault();
    attachSortByHandler(this, event);
  });
});
$(function () {
  $(".homepage-feed").on("click", ".load-more__link", function (e) {
    e.preventDefault();
    var url = $(this).attr("href");
    var button = $(this).parent();
    loadFeed(url, button);
  });

  $(".homepage-feed").on("click", ".load-more__button", function (e) {
    e.preventDefault();
    var url = $(this).find("a").attr("href");
    var button = $(this);
    loadFeed(url, button);

  });

  function loadFeed(url, button) {
    var domain = window.location.origin;
    $.ajax({
      url: url,
      beforeSend: function () {
        button.addClass("loading");
      },
      success: function (data) {
        button.remove();
        $(".homepage-feed").append(data);
      }
    });
  }
});
